(1, '2016-02-24 01:43:29', '2016-02-24 01:43:29', 1, '5611547', '9070003076', 'Хот, суурины ус хангамж, ариутгах татуургын ашиглалт, үйлчилгээг зохицуулах зөвлөл', NULL, NULL, '', '', '', '', '', '', '', '', NULL, NULL, NULL, NULL, NULL),
(11, '2016-03-03 04:18:05', '2016-08-10 01:30:11', 1, '1234567', '1234567', 'Инносолюшн', 'ХХК', '2005-12-01', '99055788', 'unenbat@innosol.mn', '77123456', 'УБ-шуудан хайрцаг 501', 'Барилга. МН оффис 201 тоот', '“Инносолюшн” ХХК нь үйлдвэрлэл барилгын автоматжуулалт, мэдээллийн технологийн чиглэлээр үйл ажиллагаа явуулахаар 2006 оны 5-р сард 3 хүний бүрэлдэхүүнтэй байгуулагдсан. Орчин үеийн мэдээллийн технологийн ололт амжилтанд хөл нийлүүлэн алхаж эх орныхоо хөгжил дэвшилд өөрсдийн хувь нэмрийг оруулахаар үйл ажиллагаагаа шинэ түвшинд гаргаж, Монголын оюунлаг залуусын ур ухаанаар шинийг санаачлан бүтээж Монголдоо тэргүүлэн дэлхийд танигдах зорилго, зорилтоо биелүүлэхээр ажиллаж байна. Бид үйл ажиллагаагаа явуулж эхэлснээс хойш чамгүй олон ажил үйлчилгээг, төсөл хөтөлбөрүүдийг хэрэгжүүлээд байгаа бөгөөд цаашид ч үйл ажиллагаагаа өргөжүүлэн, хэрэглэгч үйлчлүүлэгчиддээ чанартай, тэдний хэрэгцээ шаардлагад нийцсэн технологийн шийдлүүдээр хангаж, ашиглалтын үеийн шаардлагатай үйлчилгээнүүдээр тасралтгүй ханган нийлүүлэн ажилланаg.', 'Инносолюшн/base/10.png', 'Инносолюшн/base/8.png', 11, NULL, 72, 43, 24),
(12, '2016-03-03 04:19:27', '2016-03-30 07:38:23', 1, '2602873', '1314001004', 'Цант-Орхон', 'ХХК', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, NULL),
(13, '2016-03-03 04:20:29', '2016-03-30 07:38:23', 1, '5215544', '9011145096', 'Гангар-Орд', 'ХХК', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, NULL),
(14, '2016-03-03 04:21:11', '2016-04-22 02:04:32', 1, '2802813', '2012001002', 'Эрдэнэт ус, дулаан түгээх сүлжээ', 'ОНӨХК', '1974-11-01', '70350916', 'erdenet_usdts@mongol.net', '976-70372136', 'шуудангийн газар', 'өөрийн байр', '1974 оны 11-р сард Булган аймгийн Эрдэнэт хорооны салбар нэртэйгээр анх үйл ажиллагаагаа эрхэлж эхэлсэн.\r\nБНМАУ-ын АИХТ-ийн 1975 оны 266-р зарлигаар Булган аймгийн Эрдэнэт хороог 1976.01.01-ний өдрөөс эхлэн Эрдэнэт хот болгон зохион байгуулснаар Эрдэнэт хотын НААҮ-ний байгууллага болж бүтцийн өөрчлөлтөнд орсон. \r\n1989 оноос Эрдэнэт хотын Орон сууц нийтийн аж ахуйн газар, 1999 оноос “Эрдэнэт ус” үйлдвэрийн газар, 2003 оноос “Эрдэнэт ус, дулаан түгээх сүлжээ” ОНӨХК болж тус тус бүтцийн өөрчлөлтөнд орж байсан. \r\nОрхон аймгийн ИТХ-ын тэргүүлэгчдийн 2013 оны 83-р тогтоолоор “Эрдэнэт амьдрал” ОНӨХХК-тай нэгдэж, одоогийн бүтэц зохион байгуулалтаар ажиллаж байна.\r\nЭрхэлдэг ажлын үндсэн чиглэл:Дулаан түгээх\r\nТуслах эрхлэх үйл ажиллагааны чиглэл: Халуун хүйтэн усаар хангах, бохир ус цуглуулах, цэвэршүүлэх, ариутгах үйл ажиллагаа, усны тоолуурын засвар, үйлчилгээ, шалгах, суурилуулах \r\n', 'Эрдэнэт ус, дулаан түгээх сүлжээ/base/Chrysanthemum_3uPwhOA.jpg', 'Эрдэнэт ус, дулаан түгээх сүлжээ/base/Desert_bg6Dzb1.jpg', 61, NULL, 4, 403, 11),
