(128, '2016-03-04 02:27:53', '2016-04-23 04:50:38', 1, '2726394', '714001006', 'Дорнод нийтийн аж ахуй', 'ОНӨААТҮГ', '1969-10-01', '70584557', 'dornod_naa@yahoo.com', '12645656323', '1233465', 'Дорнод, Хэрлэн, 7-р баг, Аймгийн гаалийн баруун талд', '“Дорнод НАА” ХХК нь анх 1969 онд байгуулагдсан ба 2003 оноос одоог хүртэл менежментийн гэрээгээр ажиллаж байна. Тус компани нь барилга угсралтын тусгай зөвшөөрлийн хүрээнд энэ жил 600 сая төгрөгний орлого олж төлөвлөгөөт алдаглыг бууруулж чадсан байна. Түүнчлэн МОН 1907 төслөөр айл өрхийг 90 % тоолууржуулснаар усны алдагдлыг бууруулж, усны хэрэглээг 15%-иар багасгасан болно. \r\nГэр хорооллын төвлөрсөн шугамд холбогдсон 19 худаг, 12 усан сан, 2 усны автомашинтай Дорнод аймгийн Чойбалсан хотын хүн амыг цэвэр усаар хангах ажлыг гүйцэтгэж байна. Нийт  8145 айл өрхтэй ба тоолууржилт-90%, аж ахуйн нэгжийн тоолууржилт-100% болно. \r\nУс хангамж, ариутгах татуургын ашиглалт, үйлчилгээний тусгай зөвшөөрлийг БХБЯ-ны сайдын 2010 оны 5 дугаар сарын 20-ны өдрийн 199 тоот тогтоолоор 2015 оны 6 дугаар сарын 07 хүртэл авсан болно.\r\n', '', '', 21, NULL, 68, 1128, 1),
(129, '2016-03-04 02:29:28', '2016-04-22 04:17:10', 1, '3855562', '1414001001', 'Төв чандмань ДЭХГ', 'ОНӨААТҮГ', '2005-07-28', '70273756', 'tuvchandmani@yahoo.com', '976-70273756', '', 'Өөрийн байр', '1931 онд байгуулагдсан. 1972 он:   Үйлдвэр  хоршооллын холбоо, Нийгэм хангамжийн товчоодыг нэгтгэн аймгийн НААҮУГазар,  1990 он: Эрчим хүчний салбартай нэгтгэн ДЭХГ болгон байгуулсан.\r\n\r\n1991 оны 198-р тогтоолоор УСОС-ны Чандмань компани / УҮГ/ байгуулагдсан. 2005 он: Аймгийн Засаг даргын 329 тоот  захирамжаар УСОС-ны Чандмань компани, ДЭХГ хоёрыг татан буулгаж дахин нэгтгэн  Төв Чандмань-ДЭХГ / ОНӨҮГ/-ыг байгуулсан\r\n\r\nЭрхэлдэг ажлын үндсэн чиглэл:\r\nДулаан хангамж, Ус хангамж, ариутгах татуургын ашиглалт, засвар\r\n', '', '', 41, NULL, 11, 2136, 4),
