(18, '2016-03-04 05:58:25', '2016-03-30 07:38:23', 1, '5019729', '9011008013', 'Булнайн-Ар', 'ХХК', '2005-09-29', '99990889', 'bulnain-ar@ub-holding.mn', '', '', 'Эрдэнэтолгойн 29-541-А тоот', '       "Булнайн Ар" ХХК нь 2005 онд барилга ашиглалт, гадаад худалдааны чиглэлээр үүсгэн байгуулагдсан. "Булнайн Ар" ХХК нь 2013 оны 2-р улирлаас үйл ажиллагаагаа өргөтгөх чиглэлээр "Хот суурины ус хангамж ариутгах татуургын ашиглалт, үйлчилгээг зохицуулах зөвлөл"-өөс олгосон "Хот суурины ус хангамж, ариутгах татуургын ашиглалт үйлчилгээ", Эрчим хүчний зохицуулах хорооноос олгосон "Дулаан түгээх", "Дулаанаар зохицуулалттай хангах" мөн Стандартчилал хэмжилзүйн газраас олгосон "Ф15-200 хүртэлх голчтой цэвэр усны тоолуур суурилуулах" зэрэг тусгай зөвшөөрлүүдийн хүрээнд үйл ажиллагаа явуулж байна. \r\nӨнөөдрийн байдлаар нийт 34 ажилчинтайгаар 1026 айл өрх, 19 аж ахуйн нэгж байгууллагуудыг ус дулаанаар ханган, инженерийн шугам сүлжээний ашиглалт, үйлчилгээг хариуцан ажиллаж байна. \r\n   Цаашид салбартаа нэвтэрч буй шинэ техник, технологийг тухай бүр үйл ажиллагаандаа нэвтрүүлэн, мэргэжлийн ажилчдын мэдлэг, ур чадварыг байнга хөгжүүлэн иргэдийн ая тухтай амьдрах орчинг бүрдүүлэн ажиллах болно. \r\n   Бид "Шуурхай мэдээллийн төв"-ийг байгуулахаар төлөвлөн эхний үе шатны ажил болох мэдээллийн төвийн байрыг тусгайлан тохижуулж, тус төвийг өөрсдийн хариуцдаг хотхонуудтай мэдээлэл солилцох сүлжээгээр холбож төвийг стандартад нийцүүлэн тоног төхөөрөмж хэрэгслүүдээр тохижуулсан.', 'Булнайн-Ар/base/2016_03_03_10_31_330001.jpg', 'Булнайн-Ар/base/2016_03_03_10_26_300001.jpg', '70127799', 132, '2016-03-30 07:38:23', '~', 18, 11, NULL, 72, NULL, 55, 25),
