(14, '2016-03-03 04:21:11', '2016-04-22 02:04:32', 1, '2802813', '2012001002', 'Эрдэнэт ус, дулаан түгээх сүлжээ', 'ОНӨХК', '1974-11-01', '70350916', 'erdenet_usdts@mongol.net', '976-70372136', 'шуудангийн газар', 'өөрийн байр', '1974 оны 11-р сард Булган аймгийн Эрдэнэт хорооны салбар нэртэйгээр анх үйл ажиллагаагаа эрхэлж эхэлсэн.\r\nБНМАУ-ын АИХТ-ийн 1975 оны 266-р зарлигаар Булган аймгийн Эрдэнэт хороог 1976.01.01-ний өдрөөс эхлэн Эрдэнэт хот болгон зохион байгуулснаар Эрдэнэт хотын НААҮ-ний байгууллага болж бүтцийн өөрчлөлтөнд орсон. \r\n1989 оноос Эрдэнэт хотын Орон сууц нийтийн аж ахуйн газар, 1999 оноос “Эрдэнэт ус” үйлдвэрийн газар, 2003 оноос “Эрдэнэт ус, дулаан түгээх сүлжээ” ОНӨХК болж тус тус бүтцийн өөрчлөлтөнд орж байсан. \r\nОрхон аймгийн ИТХ-ын тэргүүлэгчдийн 2013 оны 83-р тогтоолоор “Эрдэнэт амьдрал” ОНӨХХК-тай нэгдэж, одоогийн бүтэц зохион байгуулалтаар ажиллаж байна.\r\nЭрхэлдэг ажлын үндсэн чиглэл:Дулаан түгээх\r\nТуслах эрхлэх үйл ажиллагааны чиглэл: Халуун хүйтэн усаар хангах, бохир ус цуглуулах, цэвэршүүлэх, ариутгах үйл ажиллагаа, усны тоолуурын засвар, үйлчилгээ, шалгах, суурилуулах \r\n', 'Эрдэнэт ус, дулаан түгээх сүлжээ/base/Chrysanthemum_3uPwhOA.jpg', 'Эрдэнэт ус, дулаан түгээх сүлжээ/base/Desert_bg6Dzb1.jpg', '70350217', 147, '2016-04-22 02:04:32', '~', 14, 61, NULL, 4, 269, 403, 11);
