(128, '2016-03-04 02:27:53', '2016-04-23 04:28:41', 1, '2726394', '714001006', 'Дорнод нийтийн аж ахуй', 'ОНӨААТҮГ', '1969-10-01', '70584557', 'dornod_naa@yahoo.com', '12645656323', '1233465', '', '“Дорнод НАА” ХХК нь анх 1969 онд байгуулагдсан ба 2003 оноос одоог хүртэл менежментийн гэрээгээр ажиллаж байна. Тус компани нь барилга угсралтын тусгай зөвшөөрлийн хүрээнд энэ жил 600 сая төгрөгний орлого олж төлөвлөгөөт алдаглыг бууруулж чадсан байна. Түүнчлэн МОН 1907 төслөөр айл өрхийг 90 % тоолууржуулснаар усны алдагдлыг бууруулж, усны хэрэглээг 15%-иар багасгасан болно. \r\nГэр хорооллын төвлөрсөн шугамд холбогдсон 19 худаг, 12 усан сан, 2 усны автомашинтай Дорнод аймгийн Чойбалсан хотын хүн амыг цэвэр усаар хангах ажлыг гүйцэтгэж байна. Нийт  8145 айл өрхтэй ба тоолууржилт-90%, аж ахуйн нэгжийн тоолууржилт-100% болно. \r\nУс хангамж, ариутгах татуургын ашиглалт, үйлчилгээний тусгай зөвшөөрлийг БХБЯ-ны сайдын 2010 оны 5 дугаар сарын 20-ны өдрийн 199 тоот тогтоолоор 2015 оны 6 дугаар сарын 07 хүртэл авсан болно.\r\n', '', '', '1236564', 153, '2016-04-23 04:28:41', '~', 128, 21, NULL, 68, 156, 1128, 1),
(128, '2016-03-04 02:27:53', '2016-04-23 04:28:41', 1, '2726394', '714001006', 'Дорнод нийтийн аж ахуй', 'ОНӨААТҮГ', '1969-10-01', '70584557', 'dornod_naa@yahoo.com', '12645656323', '1233465', '', '“Дорнод НАА” ХХК нь анх 1969 онд байгуулагдсан ба 2003 оноос одоог хүртэл менежментийн гэрээгээр ажиллаж байна. Тус компани нь барилга угсралтын тусгай зөвшөөрлийн хүрээнд энэ жил 600 сая төгрөгний орлого олж төлөвлөгөөт алдаглыг бууруулж чадсан байна. Түүнчлэн МОН 1907 төслөөр айл өрхийг 90 % тоолууржуулснаар усны алдагдлыг бууруулж, усны хэрэглээг 15%-иар багасгасан болно. \r\nГэр хорооллын төвлөрсөн шугамд холбогдсон 19 худаг, 12 усан сан, 2 усны автомашинтай Дорнод аймгийн Чойбалсан хотын хүн амыг цэвэр усаар хангах ажлыг гүйцэтгэж байна. Нийт  8145 айл өрхтэй ба тоолууржилт-90%, аж ахуйн нэгжийн тоолууржилт-100% болно. \r\nУс хангамж, ариутгах татуургын ашиглалт, үйлчилгээний тусгай зөвшөөрлийг БХБЯ-ны сайдын 2010 оны 5 дугаар сарын 20-ны өдрийн 199 тоот тогтоолоор 2015 оны 6 дугаар сарын 07 хүртэл авсан болно.\r\n', '', '', '1236564', 154, '2016-04-23 04:28:41', '~', 128, 21, NULL, 68, 156, 1128, 1),
