(11, '2016-03-03 04:18:05', '2016-08-09 08:42:56', 1, '1234567', '1234567', 'Инносолюшн', 'ХХК', '2005-12-01', '99055786', 'unenbat@innosol.mn', '77123456', 'УБ-шуудан хайрцаг 501', 'Барилга. МН оффис 201 тоот', '“Инносолюшн” ХХК нь үйлдвэрлэл барилгын автоматжуулалт, мэдээллийн технологийн чиглэлээр үйл ажиллагаа явуулахаар 2006 оны 5-р сард 3 хүний бүрэлдэхүүнтэй байгуулагдсан. Орчин үеийн мэдээллийн технологийн ололт амжилтанд хөл нийлүүлэн алхаж эх орныхоо хөгжил дэвшилд өөрсдийн хувь нэмрийг оруулахаар үйл ажиллагаагаа шинэ түвшинд гаргаж, Монголын оюунлаг залуусын ур ухаанаар шинийг санаачлан бүтээж Монголдоо тэргүүлэн дэлхийд танигдах зорилго, зорилтоо биелүүлэхээр ажиллаж байна. Бид үйл ажиллагаагаа явуулж эхэлснээс хойш чамгүй олон ажил үйлчилгээг, төсөл хөтөлбөрүүдийг хэрэгжүүлээд байгаа бөгөөд цаашид ч үйл ажиллагаагаа өргөжүүлэн, хэрэглэгч үйлчлүүлэгчиддээ чанартай, тэдний хэрэгцээ шаардлагад нийцсэн технологийн шийдлүүдээр хангаж, ашиглалтын үеийн шаардлагатай үйлчилгээнүүдээр тасралтгүй ханган нийлүүлэн ажиллана.', 'Инносолюшн/base/Husnegt_4.jpg', 'Инносолюшн/base/Gerchilee Ar tal.png', '77123456', 173, '2016-08-09 08:42:56', '~', 11, 11, NULL, 72, 272, 42, 24),
