INSERT INTO `app_huuli_durem_norm` (`id`, `code`, `name`) VALUES
(1, '2011.10.06', 'Хот, суурины ус хангамж ариутгах татуургын ашиглалтын тухай хууль'),
(2, '2012.05.17', 'Усны тухай хууль'),
(3, '2003.06.18', 'Сууц өмчлөгчдийн холбооны эрх зүйн байдал, нийтийн зориулалттай орон сууцны байшингийн дундын өмчлөлийн эд хөрөнгийн тухай хууль'),
(4, '1999.04.22', 'Орон сууцны тухай хууль'),
(5, '40-05-98/2005', 'Барилга доторхи усан хангамж ариутгах татуурга'),
(6, '3.05.01-88', 'Дотор сантехникийн систем'),
(7, '40-01-06', 'Ариутгах татуурга, гадна сүлжээ ба байгууламж'),
(8, '40-02-06', 'Ус хангамж, гадна сүлжээ ба байгууламж'),
(9, '13-04-03', 'Барилга байгууламж инженерийн шугам сүлжээний засвар ашиглалтын хугацааны жишиг норм'),
(10, 'ЗТБХБСайдын 2009 оны 79 дүгээр тушаал', 'Орон сууцны барилгын техник ашиглалтын дүрэм'),
(11, '3.05.04-90', 'Усан хангамж бохир ус, гадна шугам сүлжээ, түүний барилга байгууламж'),
(12, '40-102-06', 'Ус хангамж, ариутгах татуургын сүлжээний хуванцар хоолойг төлөвлөх ба угсрах. Үндсэн журам'),
(13, 'БХБСайдын 2008 оны 119 дүгээр тушаал', 'Ус, дулаан дамжуулах төвийн машинистын орон тооны жишиг норматив'),
(14, 'ЗТБХБСайдын 2011 оны 254 дүгээр тушаал', 'Ус хангамж, ариутгах татуургын инженерийн барилга байгууламжид хийгдэх төлөвлөгөөт урьдчилсан засварын дүрэм'),
(15, 'ЗТБХБСайдын 2010 оны 389 дүгээр тушаалын 1-р хавсралт', 'Ус хангамжийн эх үүсвэрийн барилга байгууламжийн техник ашиглалтын заавар'),
(16, 'БХБНААҮТөвийн даргын 2008 оны 177 дугаар тушаал', 'Ус сувгийн салбарын тариф мэргэжлийн лавлах'),
(17, 'ЗТБХБСайдын 2010 оны 389 дүгээр тушаалын 2 дугаар хавсралт', 'Орон сууцны барилгын доторх сантехникийн тоноглол солих, сантехникийн дотор системийг туршиж шалгах журам'),
(18, 'ХСУХАТАҮЗЗөвлөлийн 2013 оны 36 дугаар тогтоол', 'Техникийн нөхцөл олгох журам'),
(19, 'ХСУХАТАҮЗЗөвлөлийн 2013 оны 6 дугаар тогтоол', 'Аж ахуйн харилцааны дүрэм'),
(20, 'ХСУХАТАҮЗЗөвлөлийн 2016 оны 18 дугаар тогтоол', 'Тусгай зөвшөөрлийн нөхцөл шаардлага');
